Cottage, The (2008)  

Verenigd Koninkrijk
Komedie / Horror
92 minuten

geregisseerd door Paul Andrew Williams
met Andy Serkis, Jennifer Ellison en Steve O'Donnell

Op een nacht komt er een auto aan bij een afgelegen huisje. De broers David en Peter kruipen uit de auto en inspecteren het huisje. Het is perfect voor hun plan, het ontvoeren van Tracey, de dochter van maffiabaas Arnie. Andrew, de stiefbroer van Tracey helpt de broers. Maar twee handlangers van Arnie hebben Andrew gevolgd en wachten nu buiten op hun baas. Tijdens het wachten ontsnapt Tracey en vlucht door de bossen op zoek naar een huis met een telefoon om haar vader te bellen. Maar dat had ze beter niet gedaan...

